content:
You can use the computeRelative transformation to analyze trends in your data by adding derived fields to a dataset based on values in other rows. For example, to analyze sales pipeline trends, create derived fields that calculate the number of days an opportunity remains in each stage.

The computeExpression transformation and computeRelative transformation are similar, but the computeExpression transformation performs calculations based on fields within the same row. The computeRelative transformation performs calculations based on the same field in other rows—particularly the current, first, previous, or next rows.

When you define a computeRelative transformation, you specify a source transformation as the input, partition the records, and sort the records within each partition. For example, you can use sfdcDigest transformation to extract opportunity history records, and then use computeRelative transformation to calculate changes in each opportunity over time.

Derived fields can be based on a source field or on a SAQL expression.

Let’s look at an example. To perform trending analysis on sales pipeline data, create the following dataflow definition:

{
  "extractOppHistory": {
        "action": "sfdcDigest",
        "parameters": {
            "object": "OpportunityHistory",
            "fields": [          
                {"name": "OpportunityId"}, 
                {"name": "CreatedDate"},                
                {"name": "StageName"},        
                {"name": "Amount"},          
                {"name": "CloseDate"}         
            ]      
        }    
    },
  "computeTrending": {
    "action": "computeRelative",
    "parameters": {
      "source": "extractOppHistory",
      "partitionBy": ["OpportunityId"],
      "orderBy": [
        {
          "name": "CreatedDate",
          "direction": "asc"
        }
      ],
      "computedFields": [
        {
          "name": "OpportunityCreatedDate",
          "label": "Opportunity Created Date",
          "description": "Determines the date that the opportunity was first created.",
          "expression": {
            "sourceField": "CreatedDate",
            "offset": "first()",
            "default": "current()"
          }
        },
        {
          "name": "AmountPrev",
          "label": "Previous Amount",
          "description": "Determines the previous amount of the opportunity",
          "expression": {
            "sourceField": "Amount",
            "offset": "previous()",
            "default": "null"
          }
        },
        {
          "name": "CloseDatePrev",
          "label": "Previous Close Date",
          "description": "Determines the previous expected close date for the opportunity",
          "expression": {
            "sourceField": "CloseDate",
            "offset": "previous()",
            "default": "current()"
          }
        },
        {
          "name": "AmountChange",
          "label": "Amount % Change",
          "description": "Determines percentage change from previous amount",
          "expression": {
            "saqlExpression": "(current(Amount)-previous(Amount))/previous(Amount)*100",
            "type": "Numeric",
            "scale": 2,
            "default": "null"
          }
        },
        {
          "name": "AmountChangeDirection",
          "label": "Amount Change Direction",
          "description": "Determines text to indicate direction of change",
          "expression": {
            "saqlExpression": "case when current(Amount)>previous(Amount) then \"Up\" when current(Amount)<previous(Amount) then \"Down\" else \"No Change\" end",
            "type": "Text",
            "default": ""
          }
        }
      ]
   }
  },
  "Register_OppportunityHistory_Dataset": {
    "action": "sfdcRegister",
    "parameters": {
      "alias": "SalesPipelineTrending1",
      "name": "Sales Pipeline Trending1",
      "source": "computeTrending"
    }
  }
}

The dataflow runs and creates the dataset with the new derived fields.

When you define a computeRelative transformation, you set the action attribute to computeRelative. You also specify the parameters for the input source, partition-by field, sort field, and derived field definitions.
